DROP TABLE IF EXISTS `profile`;
CREATE TABLE `profile` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `uid` char(10)  NOT NULL,
  `user_id` int(10) unsigned DEFAULT NULL,
  `household_id` int(10) unsigned DEFAULT NULL,
  `added_by` int(10) unsigned DEFAULT NULL,
  `cn_name` varchar(255)  NOT NULL,
  `first_name` varchar(255)  NOT NULL,
  `last_name` varchar(255)  NOT NULL,
  `sex` enum('M','F')  DEFAULT NULL COMMENT 'M=Male, F=Female',
  `birth` year(4) NOT NULL,
  `phone` varchar(255)  NOT NULL,
  `wechat` varchar(255)  NOT NULL,
  `address` varchar(255)  NOT NULL,
  `address2` varchar(255)  NOT NULL,
  `city` varchar(255)  NOT NULL,
  `state` varchar(255)  NOT NULL,
  `country` varchar(255) NOT NULL,
  `zipcode` varchar(255) NOT NULL,
  `believe` year(4) DEFAULT NULL,
  `church_id` int(10) unsigned DEFAULT NULL,
  `serve` tinyint(3) unsigned DEFAULT NULL COMMENT '1=NA;2=Missionary;3=Pastor;4=Seminary;5=Nonprofit;6=Campus;7=Deacon;8=Fellowship;9=Other',
  `status` tinyint(3) unsigned DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `uid` (`uid`),
  KEY `household_id` (`household_id`),
  KEY `user_id` (`user_id`),
  KEY `church_id` (`church_id`),
  KEY `added_by` (`added_by`)
) ;
