  `event_id` int(10) unsigned NOT NULL,
  `profile_id` json NOT NULL COMMENT 'participant''s profile id(s), in JSON format',
  `created_on` datetime NOT NULL,
  `last_update` timestamp NOT NULL ON UPDATE CURRENT_TIMESTAMP,
  `status` tinyint(4) NOT NULL COMMENT '0=canceled;1=unpaid;2=pending payment(group);3=paid;minus=incomplete in option X',
  `price_model` tinyint(4) unsigned NOT NULL COMMENT '0=default, based on current time;1=early bird;2=early bird group;3=normal;4=normal group;5=late price',
  `adult` tinyint(3) unsigned NOT NULL,
  `meal` tinyint(3) unsigned DEFAULT NULL,
  `stripe_customer_id` varchar(255) NOT NULL,
  `note` varchar(255)  NOT NULL,
  `checkin_time` datetime DEFAULT NULL,
  `total_people` tinyint(3) unsigned NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `uid` (`uid`),
  KEY `user_id` (`household_id`),
  KEY `event_id` (`event_id`)
) ;

